function goto_anch_inc(anchor) {
    
    if (window.location.href.indexOf("#post") == -1) {
        var loc = document.location.toString().split('#')[0];
        document.location = loc + '#' + anchor[0];

        var NEXTPOST = document.getElementById(anchor[0])
        window.parent.postMessage(["EVT_SCROLL_TO_NEXTPOST", NEXTPOST.offsetTop], "*");
        return false;
    } else {
    
        var hash = window.location.hash.substr(1);
		for (var i = 0; i < anchor.length; i++) {

            if (anchor[i] == hash) {


                if (anchor[i + 1] != undefined) {
                    var loc = document.location.toString().split('#')[0];
                    document.location = loc + '#' + anchor[i + 1];
                    var NEXTPOST = document.getElementById(anchor[i + 1])
                    window.parent.postMessage(["EVT_SCROLL_TO_NEXTPOST", NEXTPOST.offsetTop], "*");

                } else {
                    var loc = document.location.toString().split('#')[0];
                    document.location = loc + '#' + anchor[0];
                    var NEXTPOST = document.getElementById(anchor[0])
                    window.parent.postMessage(["EVT_SCROLL_TO_NEXTPOST", NEXTPOST.offsetTop], "*");
                    return false;
                }

            }

        }


    }

}


function goto_anch_dec(anchor) {
    if (window.location.href.indexOf("#post") == -1) {
        var loc = document.location.toString().split('#')[0];
        var last = anchor.length
        document.location = loc + '#' + anchor[last - 1];
        var PREPOST = document.getElementById(anchor[last - 1])
        window.parent.postMessage(["EVT_SCROLL_TO_PREPOST", PREPOST.offsetTop], "*");
        return false;
    } else {

        var hash = window.location.hash.substr(1);
        for (var i = 0; i < anchor.length; i++) {

            if (anchor[i] == hash) {


                if (anchor[i - 1] != undefined) {
                    var loc = document.location.toString().split('#')[0];
                    document.location = loc + '#' + anchor[i - 1];
                    var PREPOST = document.getElementById(anchor[i - 1])
                    window.parent.postMessage(["EVT_SCROLL_TO_PREPOST", PREPOST.offsetTop], "*");
                } else {
                    var loc = document.location.toString().split('#')[0];
                    var last = anchor.length
                    //alert(anchor[last-1]);
                    document.location = loc + '#' + anchor[last - 1];
                    var PREPOST = document.getElementById(anchor[last - 1])
                    window.parent.postMessage(["EVT_SCROLL_TO_PREPOST", PREPOST.offsetTop], "*");
                    return false;
                }
            }

        }


    }
}

